# This file contains common pin mappings for the BIGTREETECH Octopus Max EZ.
# To use this config, the firmware should be compiled for the
# STM32H723 with a "128KiB bootloader", "25 MHz crystal",
# and one of:
# Communication interface: "USB (on PA11/PA12)",
# Communication interface: "CAN bus (on PD0/PD1)", or
# Communication interface: "USB to CAN bus bridge (USB on PA11/PA12))" and CAN bus interface: "CAN bus (on PD0/PD1)".

# See docs/Config_Reference.md for a description of parameters.



#=====================================================
# MACROS
#=====================================================
[include macros.cfg]
[include ebb-canbus-v1.2.cfg]
[include Zerog_Purge.cfg]
[include Fan.cfg]
[include TMC Autotune.cfg]
[exclude_object]

#=====================================================
# VIRTUAL SD CARD
#=====================================================
[include mainsail.cfg]
[virtual_sdcard]
path: /home/biqu/printer_data/gcodes

######################################################################
# PRINTER CONFIGURATION SECTION
######################################################################

#####################################################################
# 	X/Y Stepper Settings
#####################################################################

########################################
# X Stepper on Motor1(A Motor)
########################################
# Motor-1
[stepper_x]
step_pin: PC13
dir_pin: PC14
enable_pin: !PE6
microsteps: 64
rotation_distance: 40
endstop_pin: EBBCan:PB5
position_endstop: 1
position_max: 360
homing_speed: 150

[tmc5160 stepper_x]
stealthchop_threshold: 0
interpolate: False
cs_pin: PG14
spi_software_mosi_pin: PE14
spi_software_miso_pin: PE13
spi_software_sclk_pin: PE12
run_current: 1.6
driver_TBL: 2
driver_TOFF: 3
driver_HEND: 0
driver_HSTRT: 6
sense_resistor: 0.075

########################################
# Y Stepper on Motor2 (B Motor)
########################################
# Motor-2
[stepper_y]
step_pin: PE4
dir_pin: PE5
enable_pin: !PE3
microsteps: 64
rotation_distance: 40
endstop_pin: PF0
position_endstop: 350
position_max: 350
position_min: 0
homing_speed: 150

[tmc5160 stepper_y]
stealthchop_threshold: 0
interpolate: False
cs_pin: PG13
spi_software_mosi_pin: PE14
spi_software_miso_pin: PE13
spi_software_sclk_pin: PE12
run_current: 1.6
driver_TBL: 2
driver_TOFF: 3
driver_HEND: 0
driver_HSTRT: 6
sense_resistor: 0.075


########################################
# STEPPER Z
########################################
# Motor-3 Rear Center
[stepper_z] 
step_pin: PE1
dir_pin: PE0
enable_pin: !PE2
endstop_pin: probe:z_virtual_endstop
microsteps: 64
rotation_distance: 2
position_max: 350
position_min: -4
homing_speed: 10

[tmc2209 stepper_z]
stealthchop_threshold: 0
interpolate: False
uart_pin: PG12
run_current: 1.1
sense_resistor: 0.11

# Motor-4 Front Left 
[stepper_z1] 
step_pin: PB8
dir_pin: PB9
enable_pin: !PB7
microsteps: 64
rotation_distance: 2

[tmc2209 stepper_z1]
stealthchop_threshold: 0
interpolate: False
uart_pin: PG11
run_current: 1.1
sense_resistor: 0.11

# motor-6 Front Right
[stepper_z2]
step_pin:PB5
dir_pin: PB4
enable_pin: !PB6
microsteps: 64
rotation_distance: 2

[tmc2209 stepper_z2]
stealthchop_threshold: 0
interpolate: False
uart_pin: PG10
run_current: 1.1
sense_resistor: 0.11


########################################
# EXTRUDER
########################################
[extruder]
step_pin: EBBCan: PD0
dir_pin: !EBBCan: PD1
enable_pin: !EBBCan: PD2
microsteps: 16
rotation_distance: 22.6
gear_ratio: 50:10
nozzle_diameter: 0.4
filament_diameter: 1.750
pressure_advance: 0.02
pressure_advance_smooth_time: 0.03
heater_pin: EBBCan: PB13
sensor_type: MAX31865
sensor_pin: EBBCan: PA4
spi_bus: spi1
rtd_nominal_r: 100
rtd_reference_r: 430
rtd_num_of_wires: 2
min_temp: 0
max_temp: 420
full_steps_per_rotation: 200
max_extrude_only_distance: 1000.0
max_extrude_cross_section: 500
max_extrude_only_velocity: 200
max_extrude_only_accel: 10000

[tmc2209 extruder]
uart_pin: EBBCan: PA15
interpolate: false
run_current: 0.8 #**
sense_resistor: 0.11 #**
stealthchop_threshold: 0
driver_TBL: 0
driver_HEND: 6
driver_HSTRT: 7
driver_TOFF: 4

########################################
# BEACON
########################################
[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_F287C4685154354D38202020FF0A3A3D-if00 
x_offset: 0                             # update with offset from nozzle on your machine
y_offset: 43.15                        # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2

contact_max_hotend_temperature: 180     # increase to probe at print temps
home_xy_position: 183, 183              # update with your safe position
home_z_hop: 5
home_z_hop_speed: 30
home_xy_move_speed: 300
home_method: contact                    # use proximity for induction homing
home_method_when_homed: proximity        # after initial calibration use induction
home_autocalibrate: unhomed             # contact will calibrate beacon on first home

########################################
# RESONANCE TESTER
########################################
[resonance_tester]
accel_chip: beacon
probe_points: 183,183,20
accel_per_hz: 150

########################################
# BED MESH
########################################
[bed_mesh]
algorithm: bicubic
speed: 300
mesh_min: 50,50
mesh_max: 330,330
probe_count: 45,45

########################################
# IDLE TIMEOUT
########################################
[idle_timeout]
timeout: 172800

#=====================================================
# LIGHTS
#=====================================================
[output_pin daylight]
pin: PF7
pwm: True
cycle_time: 0.010
value: 0.50

########################################
# HEATER BED
########################################
[heater_bed]
heater_pin: PA0
sensor_pin: PB1 # TB
sensor_type: Generic 3950
#control: pid
#pid_kp: 27
#pid_ki: 0.08
#pid_kd: 0
min_temp: 0
max_temp: 120

########################################
# Z TILT
########################################
[z_tilt]
z_positions:    #It is described using nozzle coordinates (the X, Y position of the nozzle if it could move directly above the point).
  187.5, 362       #stepper_z Mini Tank
  11.5, 8           #stepper_z1 Mini Tank
  361.5, 8         #stepper_z2 Mini Tank    
points: 
  330,290  #probe location Right Rear
  40,290 #probe location Left Rear
  40,15 #probe location Left Front
  330,15 #probe location Right Front
speed: 300
retries: 10 # Number of times to retry if the probed points aren't within tolerance.
retry_tolerance:0.04

#=====================================================
# MCU ID
#=====================================================
[mcu]
canbus_uuid: e444d13ad19b

#=====================================================
# INPUT SHAPER
#=====================================================
[input_shaper]
shaper_type_x: mzv
shaper_freq_x: 64.6
shaper_type_y: mzv
shaper_freq_y: 41.6
damping_ratio_x: 0.038
damping_ratio_y: 0.045

#=====================================================
# Force Move
#=====================================================
[force_move]
enable_force_move: True

#=====================================================
# Raspberry Pi TEMP
#=====================================================
[temperature_sensor BTT_Pi_2]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

#=====================================================
# MCU TEMP
#=====================================================
[temperature_sensor Octopus_Max_EZ]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

#=====================================================
# CHAMBER TEMP
#=====================================================
[temperature_sensor chamber]
sensor_type: Generic 3950
sensor_pin: PB0

#=====================================================
# PRINTER LIMITS
#=====================================================
[printer]
kinematics: corexy
max_velocity: 2500
max_accel: 10000
#max_accel_to_decel: 5000
max_z_velocity: 20
max_z_accel: 1500
square_corner_velocity: 10

#=====================================================
# SHAKETUNE
#=====================================================
[shaketune]
# result_folder: ~/printer_data/config/ShakeTune_results
#    The folder where the results will be stored. It will be created if it doesn't exist.
# number_of_results_to_keep: 3
#    The number of results to keep in the result_folder. The oldest results will
#    be automatically deleted after each runs.
# keep_raw_csv: False
#    If True, the raw CSV files will be kept in the result_folder alongside the
#    PNG graphs. If False, they will be deleted and only the graphs will be kept.
# show_macros_in_webui: True
#    Mainsail and Fluidd doesn't create buttons for "system" macros that are not in the
#    printer.cfg file. If you want to see the macros in the webui, set this to True.
# timeout: 300
#    The maximum time in seconds to let Shake&Tune process the CSV files and generate the graphs.


